import React from "react";

function admin() {
  return (
    <>
      <div className="admin-outer-container">
        <input
          type="text"
          placeholder="Enter your email"
          className="emailpassword"
        />
        <input
          type="password"
          placeholder="Enter your Password"
          className="emailpassword"
        />
      </div>
    </>
  );
}

export default admin;
